prompt --application/shared_components/navigation/lists/dynamic_menu
begin
wwv_flow_imp_shared.create_list(
 p_id=>wwv_flow_imp.id(3996349530208687)
,p_name=>'dynamic_menu'
,p_list_type=>'SQL_QUERY'
,p_list_query=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select     level,',
'        menu_desc ||''fa-file-text''as label,',
'		        decode(page_no, null, null, ''f?p=&APP_ID.:''||"PAGE_NO"||'':&APP_SESSION.'')  as target, ',
'				''NO'' is_current,',
'        decode(page_no, null, ''fa-folder-o'', ''fa-file-text'') as image',
'   from (select menu_desc, ',
'parent_node, ',
'child_node, ',
'page_no, ',
'menu_type',
'from TREE_MENU T where menu_type = ''HOME'')',
'  start with child_node is null',
'connect by prior parent_node = child_node ',
'union all',
'select     level,',
'        menu_desc as label,',
'		        decode(page_no, null, null, ''f?p=&APP_ID.:''||"PAGE_NO"||'':&APP_SESSION.'')  as target, ',
'				''NO'' is_current,',
'        decode(page_no, null, ''fa-folder-o'', ''fa-file-text'') as image',
'   from (select menu_desc, ',
'parent_node, ',
'child_node, ',
'page_no, ',
'menu_type',
'from TREE_MENU T where menu_type = ''MAIN'')',
'  start with child_node is null',
'connect by prior parent_node = child_node'))
,p_list_status=>'PUBLIC'
,p_version_scn=>31997676
);
